```rust
struct ObjectInDB {    
    data: String,
}
impl ObjectInDB {
    pub fn new() -> ObjectInDB {
        ObjectInDB {            
            data: String::new(),
        }
    }
    pub fn get(&self) -> String {
        self.data.clone()
    }
    pub fn clone(&self) -> ObjectInDB {
        ObjectInDB {
            data: self.data.clone()
        }
    }
    pub fn into(&mut self, data: String) {
        self.data = data;
    }
}
pub struct Row {
    row: Vec<ObjectInDB>,
}
impl Row {
pub fn into(&mut self, values: Vec<String>) -> Option<bool> {
        { 
            if values.len() >  self.row.len() { return None; }
        }
        for i in 0..values.len() {
            self.row[i].into(values[i].clone());
        }
        Some(true)
    }
}
